import "./Header.css";
import React from "react";
import { AppBar, Typography, Button, Divider, Box, Grid } from "@mui/material";
import logo from "../asset/logo.png";

function Header() {
  return (
    <>
      <div id="header">
      <Box
        sx={{
          display: 'grid',
          alignItems: 'center',
          width: '100%',
          borderRadius: 1,
          color: 'text.secondary',
          '& svg': {
            m: 1.5,
          },
          '& hr': {
            mx: 0.5,
          },
        }}
      >
        <Grid container spacing={2}>
        <Typography align="left" position={"absolute"}>
          <a href="/">
            <img
              href="/"
              src={logo}
              style={{ marginTop: "0%", height: "40px" }}
            ></img>
          </a>
        </Typography>
        Create
        <Divider orientation="vertical" flexItem />
        <Typography align="right" marginRight={"3vw"}>
          <a href="/login">로그인</a>
        </Typography>
        </Grid>
        </Box>
      </div>
    </>
  );
}

export default Header;
